column43:
When the extractor service tries to convert a PNG file to pdf, it fails. It looks like it’s a weird quirk in how we need to invoke libreoffice. For converting .doc files to pdf, we invoke it like this:

{noformat}soffice --headless --convert-to pdf:writer_pdf_Export --outdir ./output-file.pdf input-file.doc{noformat}

But if you try that with a png, you get an error like this:

{noformat}Error: Please verify input parameters... (SfxBaseModel::impl_store <file:///Users/darius.ouderkirk/Downloads/output-file.pdf/output-file.pdf> failed: 0x507(Error Area:Io Class:Access Code:7)){noformat}

If you call the method for PNGs like this, however, it will work:

{noformat}soffice --headless --convert-to pdf:writer_pdf_Export --outdir ./ input-file.png{noformat}

So we need to update it to only give the output directory if it’s an image. I tested with PNG and JPG, so I’m assuming it works the same for other image types as well.

*Acceptance Criteria:*

* PDF conversion succeeds for PNG, JPG, and other image file formats

