As a user of DeepRecon, when moving the email into a different folder 

I want to select from a list of existing folders instead of manually entering a new folder name so there is consistency in folder organization with the email agent.

h4. *Acceptance Criteria:*

* a list of all existing folders (from Outlook) is shown in the menu when clicking on the update icon;
* the user can select a folder from the provided list and not edit it;
* selecting a different folder and clicking outside the box should save the changes. A message that changes are saved is shown;
* the email should be moved to the corresponding folder once confirmed (both DeepRecon and Outlook);
* should work for All, Outstanding and Completed Tabs

