The temp roles being created for the Deepview and Automations applications are not being properly cleaned up and removed.  This resulted in the Dev db to have over 600 roles.  We need to figure out why, and fix.

The issues may be with the creationStatements being used by the DatabaseSecretEngineRole.  When attempting to drop an old role, the follow error is given.

{noformat} ERROR:  role "v-kubernet-automati-asH0AEzddgHK0lfDOfhe-1720518293" cannot be dropped because some objects depend on it
 DETAIL:  privileges for default privileges on new relations belonging to role postgres in schema public{noformat}



The creation statement used to create this role is altering the default privileges which may be causing the issue.

