Technical enablement is the practice of providing individuals and teams with the knowledge, tools, and resources they need to work effectively with the technologies the organization has invested in. This may include documentation, automation, tooling, best practices, and removing technical debt to empower engineers to work more autonomously and deliver more features faster and with less negative side effects. It provides space for engineers to build solutions to help themselves by increasing their production capacity.

This Initiative is a place holder for the technical enablement tasks that do not directly result in delivered features, but will increase the engineering team’s ability to deliver features faster, reduce defects, trouble shoot production issues, and overall increase the organization’s production capacity.

