🧐{color:#0747a6} {color}{color:#0747a6}*Why do we do it (context)*{color}{color:#0747a6}:{color}

We expect an increase in volume once DRCN and Templates are integrated.  Currently the ML pipeline hasn’t been load tested with small email attachments.  We intend to run multiple tests to find optimal throughput of multiple emails that can be sent in an hour. We need to ensure that work items are successfully generated and our platform is able to handle the increased load. 

🤔 {color:#0747a6}*What we need to do (outcome):*{color}

We will have a vetted estimate of how many email attachments our current platform can handle. If we deem that number too low, we will add additional tickets to cover the work needed.  

🛑{color:#0747a6} *When do we stop (acceptance criteria)*{color}

* Confirm number for max throughput of 1 page emails.
* We are able to handle at least 1,000 work items per day.
* Work items are created within less than 2 minutes of the files arriving

