The following block in the module is attempting to manage the lifecycle of the randomly generated password. The {{number}} attribute is deprecated and should use {{numeric}} instead (or you could remove the entire attribute list and use the special value {{all}})


{noformat}resource "random_password" "rds_password" {
  length  = 32
  special = false

  lifecycle {
    ignore_changes = [
      length,
      special,
      lower,
      min_lower,
      min_numeric,
      min_special,
      min_upper,
      number,
      upper,
    ]
  }
}{noformat}

