The map of what is needed to extract for a given type of data even when it can be generated across many different variants and/or different data source types.  This is what tells the extraction model(s) what it needs to find and display from the document that it is given.  It includes classification training (three levels of specificity) and term extraction  training.

Classification and Term extraction inferences from the model will all generate a confidence score that is displayable to the user for every document.  The user can then train additional documents in the content map from a subset of the terms to improve any of the confidence scores that are not high enough.  This means that the training of the content map does not need to be holistic for every term and classification for every document variant added, but rather focused on where you want the model to improve.  This allows training to be targeted and not duplicative.

